import React from 'react';
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';
import CardData from './ServicesData'
import './Home.css'


const responsive = {
  0: { items: 1 },
  568: { items: 2 },
  1024: { items: 3 },
};


const ProCrousel = () => {
  // console.log(data)
  return (
 <>
 <div className='container'>
    <div className='row'>
        <AliceCarousel
          mouseTracking
          responsive={responsive}
          controlsStrategy="alternate"
          // autoPlay={true}
          infinite={true}
          autoPlayInterval={1500}
          disableButtonsControls={true}
          >
           {CardData.map((data) =>{
             console.log(data)
             return(
               <>
               <div className='col-md-4 col-lg-4 shadow'>
               <div className="item w-100">
                 <div className='w-100'>
                  <h1>{data.Title}</h1>
                 </div>
               </div>
               </div>
               </>
             )
             })}
        </AliceCarousel>
        </div>
    </div>
 </>
  );
}

export default ProCrousel;
